import React from "react";

const Pistols = (props) => {
  const inCaseRefresh = async () => {
    try {
      const res = await fetch(
        "https://firestore.googleapis.com/v1/projects/star-wars-weapons-info/databases/(default)/documents/weapons"
      );
      const json = await res.json();
      props.setFullData(json);
    } catch (err) {
      console.log(err.message);
    }
  };

  return (
    <div className="pistol-Card">
      <h1> Hello World</h1>
      {props.fullData
        ? console.log(props.fullData.documents[0])
        : inCaseRefresh()}
    </div>
  );
};

export default Pistols;
